import { Col } from "react-bootstrap";
import Link from "next/link";

// import styles from "./GitProject.module.scss";

export interface Props {
  language: string;
  ammount: number;
}

const GitProject: React.SFC<Props> = ({ language, ammount }) => {
  return (
    <Col md={4}>
      <p>{language}</p>
      {ammount}
    </Col>
  );
};

export default GitLang;
